import axios from 'axios';

async function fantasyapiRetrieve() {
    const response = await axios.get('https://fantasy-api.formula1.com/partner_games/f1/players#/fantasyapi-players/retrieve');
    console.log(response);
}

export default fantasyapiRetrieve;
